import React from 'react';
import { Menu } from 'semantic-ui-react';

function NavTabs({ currentPage, handlePageChange }) {
  return (
    <Menu pointing secondary>
      <Menu.Item
        name="Home"
        active={currentPage === 'Home'}
        onClick={() => handlePageChange('Home')}
      />
      <Menu.Item
        name="Attractions"
        active={currentPage === 'Attractions'}
        onClick={() => handlePageChange('Attractions')}
      />
      <Menu.Item
        name="PlacesToGo"
        active={currentPage === 'PlacesToGo'}
        onClick={() => handlePageChange('PlacesToGo')}
      />
      <Menu.Item
        name="Restaurants"
        active={currentPage === 'Restaurants'}
        onClick={() => handlePageChange('Restaurants')}
      />
      <Menu.Item
        name="Login"
        active={currentPage === 'Login'}
        onClick={() => handlePageChange('Login')}
      />
      <Menu.Item
        name="SignUp"
        active={currentPage === 'SignUp'}
        onClick={() => handlePageChange('SignUp')}
      />
    </Menu>
  );
}

export default NavTabs;
